import { makeStyles } from '@material-ui/core/styles'
import Card from '@material-ui/core/Card'
import Grid from '@material-ui/core/Grid'

const useStyles = makeStyles(theme => ({
  root: {
    padding: '30px 60px',
  },
  cardBody: {
    padding: '10px'
  },
  cardTitle: {
    fontSize: '12px',
    backgroundColor: '#3F51B5',
    padding: '3px 3px 3px 6px',
    color: '#FFF',
    fontFamily: "Roboto"
  },
  gridStyles: {
    margin: '10px 0 5px 0',
    width: '100%'
  },
  h2: {
    width: '100%',
    textAlign: 'left',
    borderBottom: '1px solid #000',
    lineHeight: '0.1em',
    margin: '10px 0 20px',
    fontFamily: 'Roboto',
    fontSize: '13px'
  },
  span: {
    background: '#fff',
    padding: '0 10px'
  }
}))

const AddMongoDBDataSource = () => {
  const classes = useStyles();

  return (
    <div className='container'>
      <Card className={classes.root}>
        <div>
          <h2 className={classes.h2}>
            <span className={classes.span}>Database Properties</span>
          </h2>
        </div>

        <div>
          <h2 className={classes.h2}>
            <span className={classes.span}>Authentication</span>
          </h2>
        </div>

        <div>
          <h2 className={classes.h2}>
            <span className={classes.span}>Miscellaneous</span>
          </h2>
        </div>

        <div>
          <h2 className={classes.h2}>
            <span className={classes.span}>Advanced</span>
          </h2>
        </div>
      </Card>
    </div>
  )
};


export default AddMongoDBDataSource;
